function Podcast(){

    const soundCloudIcon = <FontAwesomeIcon icon={faTwitter} />

    return(
        <div className="podcastDiv">
            <h1>Screen Spew</h1>
            <img src={require("../imgs/screen-spew.jpg")} alt="cover for screen spew" />
            <p>How to listen!</p>

        </div>
    );
}

export default Podcast;
